  '1. Introduction': '1. Introduction',
  'At Time Space Ventures Pvt. Ltd., d/b/a RTSN ("us", "we", "our" or the\n                  "Company") we value your privacy and the importance of safeguarding your\n                  data. This Privacy Policy (the "Policy") describes our privacy practices\n                  for the activities set out below. As per your rights, we inform you how\n                  we collect, store, access, and otherwise process information relating\n                  to individuals. In this Policy, personal data (“Personal Data”) refers to\n                  any information that on its own, or in combination with other available\n                  information, can identify an individual.':
    'À Time Space Ventures Pvt. Ltd., d/b/a RTSN ("nous", "nous", "notre" ou le\n                  "Société"), nous apprécions votre vie privée et l\'importance de protéger votre\n                  données. Cette politique de confidentialité (la « Politique ») décrit nos pratiques en matière de confidentialité\n                  pour les activités décrites ci-dessous. Conformément à vos droits, nous vous informons comment\n                  nous collectons, stockons, accédons et traitons autrement les informations relatives\n                  aux particuliers. Dans cette Politique, les données personnelles (« Données personnelles ») désignent\n                  toute information qui, seule ou en combinaison avec d\'autres informations disponibles\n                  informations, peuvent identifier un individu.',
  'The office locations of where Time Space Ventures Pvt. Ltd. can be found':
    'Les emplacements des bureaux où Time Space Ventures Pvt. se trouve',
  'We are committed to protecting your privacy in accordance with the\n                  highest level of privacy regulation. As such, we follow the obligations\n                  under the below regulations:':
    'Nous nous engageons à protéger votre vie privée conformément à la\n                  le plus haut niveau de réglementation en matière de confidentialité. A ce titre, nous respectons les obligations\n                  dans le cadre des réglementations ci-dessous :',
  "Canada's Personal Information Protection and Electronic Documents Act (PIPEDA) and the\n                    applicable provincial legislations":
    'La Loi sur la protection des renseignements personnels et les documents électroniques (LPRPDE) du Canada et la\n                    lois provinciales applicables',
  "the EU's General Protection Data Regulation (GDPR)":
    "le règlement général sur la protection des données (RGPD) de l'UE",
  'Brazil’s Data Protection Legislation (LGPD)':
    'Législation brésilienne sur la protection des données (LGPD)',
  "California's Consumer Protection Act (CCPA) / California Privacy Rights Act (CPRA) and\n                    California Online Privacy Protection Act (CalOPPA)":
    'La loi californienne sur la protection des consommateurs (CCPA) / la loi californienne sur les droits à la vie privée (CPRA) et\n                    Loi californienne sur la protection de la vie privée en ligne (CalOPPA)',
  'Colorado Privacy Act (CPA)': 'Loi sur la confidentialité du Colorado (CPA)',
  'Utah Consumer Privacy Act (UCPA)':
    "Loi sur la protection de la vie privée des consommateurs de l'Utah (UCPA)",
  'Connecticut Data Privacy Act (CTDPA)':
    'Loi sur la confidentialité des données du Connecticut (CTDPA)',
