  'South Africa’s Protection of Personal Information Act (POPIA)':
    'Loi sud-africaine sur la protection des informations personnelles (POPIA)',
  Scope: 'Portée',
  'This policy applies to the Time Space Ventures Pvt. Ltd. websites,\n                  domains, applications, services, and products.':
    "Cette politique s'applique à Time Space Ventures Pvt. sites Web Ltd.,\n                  domaines, applications, services et produits.",
  'This Policy does not apply to third-party applications, websites,\n                  products, services or platforms that may be accessed through (non-)\n                  links that we may provide to you. These sites are owned and operated\n                  independently from us, and they have their own separate privacy and\n                  data collection practices. Any Personal Data that you provide to these\n                  websites will be governed by the third-party’s own privacy policy. We\n                  cannot accept liability for the actions or policies of these independent\n                  sites, and we are not responsible for the content or privacy practices\n                  of such sites.':
    "Cette politique ne s'applique pas aux applications, sites Web,\n                  produits, services ou plates-formes accessibles via (non-)\n                  liens que nous pouvons vous fournir. Ces sites sont détenus et exploités\n                  indépendamment de nous, et ils ont leur propre vie privée et\n                  pratiques de collecte de données. Toutes les données personnelles que vous fournissez à ces\n                  les sites Web seront régis par la propre politique de confidentialité du tiers. Nous\n                  ne peut accepter la responsabilité des actions ou des politiques de ces indépendants\n                  sites, et nous ne sommes pas responsables du contenu ou des pratiques de confidentialité\n                  de tels sites.",
  'Processing Activities': 'Activités de traitement',
  'This Policy applies when you interact with us by doing any of the\n                  following:':
    "Cette politique s'applique lorsque vous interagissez avec nous en faisant l'une des\n                  suivant:",
