  'Any username, password, or any other piece of information chosen by you, or provided to you as part of our security procedures, must be treated as confidential, and you must not disclose it to any other person or entity. You agree to notify us immediately of any unauthorized access to or use of your username or password or any other breach of security. You also agree to ensure that you log out from your account at the end of each session. You are responsible for any password misuse or any unauthorized access.':
    "Tout nom d'utilisateur, mot de passe ou tout autre élément d'information que vous avez choisi ou qui vous a été fourni dans le cadre de nos procédures de sécurité doit être traité de manière confidentielle et vous ne devez le divulguer à aucune autre personne ou entité. Vous acceptez de nous informer immédiatement de tout accès ou utilisation non autorisés de votre nom d'utilisateur ou mot de passe ou de toute autre violation de la sécurité. Vous vous engagez également à veiller à vous déconnecter de votre compte à la fin de chaque session. Vous êtes responsable de tout abus de mot de passe ou de tout accès non autorisé.",
  'YOU ARE SOLELY AND ENTIRELY RESPONSIBLE FOR YOUR USE OF THE WEBSITE AND YOUR COMPUTER, INTERNET AND DATA SECURITY.':
    'VOUS ÊTES SEUL ET ENTIÈREMENT RESPONSABLE DE VOTRE UTILISATION DU SITE WEB ET DE VOTRE SÉCURITÉ INFORMATIQUE, INTERNET ET DES DONNÉES.',
  '5. Prohibited Activities': '5. Activités interdites',
  'You may use the Website only for lawful purposes and in accordance with these Terms of Service. You agree not to use the Website:':
    "Vous ne pouvez utiliser le site Web qu'à des fins licites et conformément aux présentes conditions d'utilisation. Vous vous engagez à ne pas utiliser le Site :",
  'In any way that violates any applicable federal, state, local or international law or regulation (including, without limitation, any laws regarding the exports of data software to and from the U.S. or other countries).':
    "D'une manière qui viole toute loi ou réglementation fédérale, étatique, locale ou internationale applicable (y compris, sans s'y limiter, toute loi concernant les exportations de logiciels de données vers et depuis les États-Unis ou d'autres pays).",
  'For the purpose of exploiting, harming, or attempting to exploit or harm minors in any way by exposing them to inappropriate content, asking for personally identifiable information or otherwise.':
    "Dans le but d'exploiter, de nuire ou de tenter d'exploiter ou de nuire à des mineurs de quelque manière que ce soit en les exposant à un contenu inapproprié, en demandant des informations personnellement identifiables ou autrement.",
  'To send, knowingly receive, upload, download, use, or re-use any material that does not comply with the Submission Standards set out in these Terms of Service.':
    "Pour envoyer, recevoir sciemment, télécharger, télécharger, utiliser ou réutiliser tout matériel qui n'est pas conforme aux normes de soumission énoncées dans les présentes conditions d'utilisation.",
  'To transmit, or procure the sending of, any advertising or promotional material, including any "junk mail," "chain letter," "spam," or any other similar solicitation.':
    "Pour transmettre ou obtenir l'envoi de tout matériel publicitaire ou promotionnel, y compris tout « courrier indésirable », « chaîne de lettres », « spam » ou toute autre sollicitation similaire.",
  'To impersonate or attempt to impersonate the Company, a Company employee, another user, or any other persona or entity (including, without limitation, by using email addresses associated with any of the foregoing).':
    "Usurper ou tenter d'usurper l'identité de la Société, d'un employé de la Société, d'un autre utilisateur ou de toute autre personne ou entité (y compris, sans s'y limiter, en utilisant des adresses e-mail associées à l'un des éléments susmentionnés).",
  "To engage in any other conduct that restricts or inhibits anyone's use or enjoyment of the website, or which as determined by us, may harm the Company or users of the website, or expose them to liability.":
    "S'engager dans toute autre conduite qui restreint ou empêche l'utilisation ou la jouissance du site Web par quiconque, ou qui, selon nous, peut nuire à la Société ou aux utilisateurs du site Web, ou les exposer à une responsabilité.",
  'Additionally, you agree not to:': 'De plus, vous vous engagez à ne pas :',
