  'Establish a link from any website that is not owned by you.':
    'Établissez un lien à partir de tout site Web qui ne vous appartient pas.',
  'Cause the Website or portions of it to be displayed on, or appear to be displayed by, any other site, for example, framing, deep linking, or in-line linking.':
    'Faire en sorte que le site Web ou des parties de celui-ci soient affichés ou semblent être affichés par tout autre site, par exemple, le cadrage, le lien profond ou le lien en ligne.',
