  'The Website from which you are linking, or on which you make certain content accessible, must comply in all respects with the Submission Standards set out in these Terms of Service.':
    "Le site Web à partir duquel vous créez un lien, ou sur lequel vous rendez certains contenus accessibles, doit se conformer à tous égards aux normes de soumission énoncées dans les présentes conditions d'utilisation.",
